                <div class="container d-flex">
                    <div class="">
                        <h4>If you are looking for budget trip or would like to try the overland trip (but do not want to pay for private car), traveling by bus is fun and interesting.way.</h4>
                        <div class=""><img src="https://www.travelmyanmar.com/wp-content/uploads/2018/11/bus-1.jpg" alt="" width="400px"></div>
                        <h4 style="margin-top: 20px">If you are looking for budget trip or would like to try the overland trip (but do not want to pay for private car), traveling by bus is fun and interesting.way.</h4>
                        <div class=""><img src="https://www.travelmyanmar.com/wp-content/uploads/2018/11/bus-2.jpg" alt="" width="400px"></div>
                        <h3 style="margin-top: 20px">Important Notes:</h3>
                         <ol>
                            <li><p>Prices and schedules are subject to changed. So, please contact us for accurate information.</p></li>
                            <li><p> Myanmar has several bus stations, including the main bus station in Yangon (Rangoon) and the bus station in Naypyitaw (Nay Pyi Taw). These bus stations are the primary hubs for bus transportation in the country.</p></li>
                            <li><p> Bus schedules in Myanmar are not strictly followed. Buses may arrive earlier or later than scheduled. It is recommended to check the bus schedule before boarding.</p></li>
                            <li><p>When traveling by bus in Myanmar, it is recommended to carry your passport or national ID card with you. This will be required for identification purposes.</p></li>
                            <li><p>Bus tickets in Myanmar are usually sold at the bus station or at the bus stop. You can also buy tickets online or through a travel agency.</p></li>
                            <li><p> It is important to exercise caution when traveling by bus in Myanmar. Ensure that your belongings are secure and always keep your passport or national ID card with you.</p></li>
                            <li><p>Some buses in Myanmar have toilets, while others may not. It is recommended to check the bus schedule or ask the bus driver before boarding.</p></li>
